import React from 'react';
import './About.css';
import img from '../../Assets/Harsh Jain.jpeg'

const About = () => {
  return (
    <>
    <div className="about_container">
        <span><h1>About Me</h1> &nbsp;&nbsp;&nbsp;&nbsp;
        <hr /></span>

        <div className="AboutContent_pic">
            <div className="abt_content">
                Lorem ipsum dolor, sit amet consectetur adipisicing elit. Odit reprehenderit <br/> quo placeat quae quam error eos optio facilis commodi totam adipisci aspernatur, iste minus itaque doloribus, nisi porro, quidem quibusdam?
            </div>
            <div className="abt_pic">
                <img src={img} alt="" />
            </div>
        </div>
    </div>
    </>
  )
}

export default About
